pragma solidity ^0.4.24;


/**
 * LiboPro Exchange token contract
 * 
 * Token name  : LIBO
 * Ticker      : LIBO
 * Total supply: 1 billion
 * Decimals    : 18
 * Date        : 09th of April 2020
